set autocommit=0;
INSERT INTO `field_revision_field_region_description` VALUES ('bean','ia_theme_information',0,1,1,'und',0,'Test description','filtered_html'),('bean','ia_theme_information',0,1,2,'und',0,'The first header region contains the site logo. It may contain other items such as a show/hide toggle for the header region as well as additional logos as needed.','filtered_html'),('bean','ia_theme_information',0,1,3,'und',0,'The first header region contains the site logo. It may contain other items such as a show/hide toggle for the header region as well as additional logos as needed.','filtered_html'),('bean','ia_theme_information',0,1,6,'und',0,'The first header region contains the site logo. It may contain other items such as a show/hide toggle for the header region as well as additional logos as needed. It may also contain elements typically found in other header regions on some designs.','filtered_html'),('bean','ia_theme_information',0,2,4,'und',0,'The second header region contains gateway and utility menus. The gateway menu is used to display a curated list of helpful links to users who have self-identified as one of the listed types. The utility menu contains links that many users would like quick access to, as well as links that are needed across many user types.','filtered_html'),('bean','ia_theme_information',0,2,7,'und',0,'The second header region contains gateway and utility menus. The gateway menu is used to display a curated list of helpful links to users who have self-identified as one of the listed types. The utility menu contains links that many users would like quick access to, as well as links that are needed across many user types. It may also contain elements typically found in other header regions on some designs.','filtered_html'),('bean','ia_theme_information',0,3,5,'und',0,'The header third region will contain the main navigation of the site. It may also contain elements typically found in other header regions on some designs.','filtered_html'),('bean','ia_theme_information',0,4,8,'und',0,'The content header region provides a full-width area above all other content on the page, but below the header. This region may contain a large billboard image(s), breadcrumbs, page title, emergency alerts, or any other elements that would provide a large visual or navigational choice to the user.','filtered_html'),('bean','ia_theme_information',0,5,9,'und',0,'The content right region is used in conjunction with the content left region to compare two sections of similar content side-by-side.','filtered_html'),('bean','ia_theme_information',0,5,12,'und',0,'The content right region is used in conjunction with the content left region to compare two sections of similar content side-by-side.','filtered_html'),('bean','ia_theme_information',0,6,10,'und',0,'The content left region is used in conjunction with the content right region to compare two sections of similar content side-by-side.','filtered_html'),('bean','ia_theme_information',0,6,11,'und',0,'The content left region is used in conjunction with the content right region to compare two sections of similar content side-by-side.','filtered_html'),('bean','ia_theme_information',0,7,13,'und',0,'The content footer region provides a full-width area below all other content on the page, but above the footer. This region may contain postscript data relating to the content of the page, promos spanning the full width of the page, or other full-width content on a per-layout basis.','filtered_html'),('bean','ia_theme_information',0,8,14,'und',0,'The footer first region will contain the footer navigation, usually consisting of legal/privacy/accessibility information, contact information, locations and directions, as well as a link to a sitemap.','filtered_html'),('bean','ia_theme_information',0,9,15,'und',0,'The footer second region will contain global contact information and legal/copyright information. It may also contain social media links as well as accreditation and affiliation links.','filtered_html'),('bean','ia_theme_information',0,9,16,'und',0,'The footer second region will contain global contact information and legal/copyright information. It may also contain social media links as well as accreditation and affiliation links.','filtered_html'),('bean','ia_theme_information',0,10,17,'und',0,'The navigation sidebar region contains a listing of all links located under the top level navigation for the current section. It may also contain promos related to navigating users to another piece of content related to the current page.','filtered_html'),('bean','ia_theme_information',0,11,18,'und',0,'The featured content region can contain a large image, video or promo that should be the main focus of the page. It may also contain a content introduction','filtered_html'),('bean','ia_theme_information',0,12,19,'und',0,'The above content region is used to insert boilerplate content or promos shown just above the content but within the same column width.','filtered_html'),('bean','ia_theme_information',0,13,20,'und',0,'The below content region is used to insert boilerplate content or promos shown just below the content but within the same column width.','filtered_html'),('bean','ia_theme_information',0,14,21,'und',0,'The Promo Sidebar Region should contain Call-to-Action content directing users to offerings and common goals.','filtered_html');
/*!40000 ALTER TABLE `field_revision_field_region_description` ENABLE KEYS */;
UNLOCK TABLES;
commit;

